import React from 'react';
import './Add.css';

class Add extends React.Component {
    constructor(props) {
        super(props);
        this.state = {
            activeTab: "Add a Flight"
        }
    }

    changeTab(tabName) {
        this.setState({activeTab: tabName});
        this.props.setHeader(tabName)
    }
    renderTabs() {
        return (
            <div className="tabs">
                <button className={this.state.activeTab == 'Add a Flight' ? "tab activeTab": "tab"} onClick={()=>{this.changeTab('Add a Flight')}}>FLIGHT</button>
                <button className={this.state.activeTab == 'Add an Event' ? "tab activeTab": "tab"} onClick={()=>{this.changeTab('Add an Event')}}>EVENT</button>
                <button className={this.state.activeTab == 'Add a Meeting' ? "tab activeTab": "tab"} onClick={()=>{this.changeTab('Add a Meeting')}}>MEETING</button>
            </div>
        )
    }
    render() {
        return(
            <div>
                {this.renderTabs()}
                <p>Hello World</p>
            </div>

        )
    }
}

export default Add;
